import React, { memo } from 'react';
import styles from './Scenes.module.scss'

function Scenes() {
  return (
    <div className={styles.scenes}>
        <ul className={styles.scenes__list}>
            <li className={styles.scenes__item}><img src="/assets/images/Coding.png" alt='List icon' className={styles.scenes__image}/></li>
            <li className={styles.scenes__item}><img src="/assets/images/Development.png" alt='List icon' className={styles.scenes__image}/></li>
            <li className={styles.scenes__item}><img src="/assets/images/Tree.png" alt='List icon' className={styles.scenes__image}/></li>
            <li className={styles.scenes__item}><img src="/assets/images/Aqua.jpg" alt='List icon' className={styles.scenes__image}/></li>

            <li className={styles.scenes__item}><img src="/assets/images/Sunshine.jpg" alt='List icon' className={styles.scenes__image}/></li>
        </ul>
    </div>
  )
}

export default memo(Scenes)
